column8:
見た目はシンプルでも中には機能がいっぱい<br>内側に隠された大小様々なポケットのお蔭できちんと整理整頓できます<br>背面にはティッシュケース機能も備わり身だしなみもバッチリ<br><br>[サイズ]: 高さ/約9cm, 幅/約17cm, 奥行/約7cm<br>[重量]: 約90g<br>[素材]: 表地/綿100%, 裏地/ナイロン100%<br>[生産国]: 日本<br>[企画国]: 日本<br>[性別]: レディース<br><br>【spia(スピーア)とは……】<br>大切なもの、毎日使うもの、愛着のあるもの、これらをすべて運ぶための道具。さまざまな用途に合わせた機能。さりげなくオシャレを演出。それを忍ばせるとなぜか自信が出る。「spia」はそんな隠れた存在。隠れているものだからこそ、最高のクリエイティブ･最高のパフォーマンスをもってお届けしていきます。<br><br>※商品色はご覧になるモニターの特性により実物の色と多少異なります。<br>※仕様変更により予告なく素材や形状が変更となる場合があります。あらかじめご了承ください。<br><br><center><img src="https://image.rakuten.co.jp/vvv/cabinet/category/outdoor16_01.jpg" width="70%" border="0"><br><br>
</center>

